import React from "react";
import {Avatar, Card} from 'antd';
const UserProfile =()=>{
    return(
        <Card
        actions={[
            <div key="twit">Jack <br/></div>,
            <div key="following">팔로잉 <br/></div>,
            <div key="follower">팔로워 <br/></div>,

        ]}>

        <Card
        avatar={<Avatar>RIV</Avatar>}
        title="River"
        />

        </Card>
    )
}
export default UserProfile;
